import React from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import {
  Navbar,
  Nav,
  Form,
  FormControl,
  Button,
  NavDropdown,
} from "react-bootstrap";
import ScriptTab from "./ScriptTab";

class PrmNavBar extends React.Component {
  constructor(props) {
    super(props);
  }
  render() {
    return (
      <Navbar bg="primary" variant="dark" border="dark">
        <Navbar.Brand href="http://localhost:3000/">PRM</Navbar.Brand>
        <Nav className="mr-auto" defaultActiveKey="#home">
          <Nav.Link href="http://localhost:3000/">Team</Nav.Link>
          <Nav.Link href="http://localhost:3000/statistics">
            General Statistics
          </Nav.Link>
          <Nav.Link href="http://localhost:3000/prediction">
            Ticket Prediction
          </Nav.Link>
          <Nav.Link href="http://localhost:3000/custom/model">
            Create Model
          </Nav.Link>
          <Nav.Link href="http://localhost:3000/admin">Admin Page</Nav.Link>
          <NavDropdown title="Team Scripts" id="basic-nav-dropdown">
            <NavDropdown.Item href="http://localhost:3000/imsscripts">IMS Scripts </NavDropdown.Item>
            <NavDropdown.Item href="http://localhost:3000/jirascripts">Jira Scripts</NavDropdown.Item>
          </NavDropdown>
        </Nav>
        <Form inline>
          <FormControl type="text" placeholder="Search" className="mr-sm-2" />
          <Button variant="outline-light">Search</Button>
        </Form>
      </Navbar>
    );
  }
}

export default PrmNavBar;
